import './App.css';
import {BrowserRouter as Router, Routes,Route, Redirect, Link} from 'react-router-dom';
import maini from './maini';

function App() {

  return (

    <Router>
    <Routes>
      <Route exact path='./maini' component={maini}/>
    </Routes>
  </Router>

  )

}

export default App;
